webpackJsonp([66789691484227],{1056:function(s,e){s.exports={data:{package:{id:"bs-nprogress",score:.45548650535052004,name:"bs-nprogress",version:"0.0.1",description:"BuckleScript bindings to nprogress",keywords:["nprogress","ocaml","bucklescript"],license:"MIT",updated:"2017-12-24T12:26:24.336Z",stars:1,type:"published",quality:.4304556734181409,popularity:.023539144838673694,maintenance:.9088888646615486,readme:'<h1>bs-nprogress</h1>\n<p>BuckleScript bindings to <a href="https://github.com/rstacruz/nprogress">nprogress</a>.</p>\n<h2>Installation</h2>\n<pre><code class="language-shell">yarn add bs-nprogress nprogress\nnpm install --save bs-nprogress nprogress\n</code></pre>\n<h2>Usage</h2>\n<p>Pretty much consistent with <a href="https://github.com/rstacruz/nprogress#basic-usage">original JS API</a>.</p>\n<pre><code class="language-reason">/* All arguments are optional */\nNProgress.configure(\n  ~minimum=0.2,\n  ~template="&#x3C;div />"\n  ~easing="ease",\n  ~speed=200,\n  ~trickle=true,\n  ~trickleSpeed=300,\n  ~showSpinner=false,\n  ~parent="#container",\n  () /* NB: Don\'t forget to apply unit! */\n);\n\nNProgress.start();\n\nNProgress.complete(); /* original: NProgress.done(); */\n\nNProgress.forceComplete(); /* original: NProgress.done(true); */\n\nNProgress.isStarted();\n\nNProgress.set(0.2);\n\nNProgress.inc();\n\nNProgress.remove();\n\nNProgress.status;\n</code></pre>\n',homepageUrl:"https://github.com/alexfedoseev/bs-nprogress#readme",repositoryUrl:"https://github.com/alexfedoseev/bs-nprogress",npmUrl:"https://www.npmjs.com/package/bs-nprogress",issuesUrl:"https://github.com/alexfedoseev/bs-nprogress/issues",slug:"packages/bs-nprogress"}},pathContext:{id:"bs-nprogress"}}}});
